import React from 'react';
import { useNavigate } from 'react-router-dom';
import './PersonalizeExperience.css'; // Ensure this CSS file contains necessary styles

function PersonalizeExperience() {
  const navigate = useNavigate();

  const handleContinue = () => {
    // Handle continue button click, e.g., navigate to another page
    navigate('/next-step'); // Replace with your actual next step route
  };

  return (
    <div className="container">
      <div className="content">
        <div className="section" id="fragment-container">
          {/* Content for fragment container */}
        </div>

        <h1 className="title">Let's personalize your experience with Meal</h1>
        <p className="subtitle">In the next few steps weâ€™ll ask you some questions to tailor your Meal experience</p>

        <div className="sections">
          {/* Section 1: Getting to Know */}
          <div className="section-box" id="section-getting-to-know">
            <h2 className="section-title">Getting to know</h2>
            <p className="section-description">Understanding who you are.</p>
          </div>

          {/* Section 2: Dietary Habits */}
          <div className="section-box" id="section-dietary-habits">
            <h2 className="section-title">Dietary Habits</h2>
            <p className="section-description">Examining your eating patterns.</p>
          </div>

          {/* Section 3: Medical Conditions */}
          <div className="section-box" id="section-medical-conditions">
            <h2 className="section-title">Medical Conditions</h2>
            <p className="section-description">Identifying any relevant medical issues.</p>
          </div>

          {/* Section 4: Goals */}
          <div className="section-box" id="section-goals">
            <h2 className="section-title">Goals</h2>
            <p className="section-description">Defining your objectives and aspirations.</p>
          </div>
        </div>

        <button className="continue-button" onClick={handleContinue}>Continue</button>
      </div>
    </div>
  );
}

export default PersonalizeExperience;
